import React from 'react'

const NavItem = ({text, url, key}) => {
  return (
    <li className='inline-block my-auto w-1/3'>
      <a href={url} className='block text-center border-r-2 border-stone-300'>{text}</a>
    </li>
  )
}

export default NavItem
